import React from 'react'
import swal from 'sweetalert';

export default function RoughPage() {

    const alert = () =>{
        swal(
            'Good job!',
            'You clicked the button!',
            'success'
          )
    }
  return (
    <div>RoughPage
        
         <br/>
        <button className='btn-sm' onClick={alert}>Alert</button>
    </div>
  )
}
